package Revised;

import java.util.Scanner;



public class ExNested {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner scan=new Scanner(System.in);
		
		for(int i=1;i<=5;i++) {
			for(int j=1;j<10;j++) {
				System.out.print(i);
			}
			System.out.println();
		}
		

	}

}
